import React from 'react'

function editFishForm() {
    return (
        <div className="fishEdit">
            <input type="text" name="name"/>
            <input type="text" name="price"/>
            <select type="text" name="status"/>
            <input type="text" name="name"/>
            <input type="text" name="name"/>/
        </div>
    )
}

export default editFishForm
